('Easy', 'Low to Moderate', 'Aquarium Plants', 'Polypodiaceae', 'Microsorum', 'Yes', 'Southeast Asia', 'Mid-Ground', 'Rhizome', , 'Java Fern (Microsorum pteropus) is a popular and enduring choice among aquarium enthusiasts. Originating from Southeast Asia, particularly countries like Malaysia, Thailand, and Indonesia, it belongs to the Polypodiaceae family and the Microsorum genus.\r\n\r\nThis aquatic plant is distinguished by its distinctive, feathery, and finely divided leaves. It thrives when attached to aquarium hardscape, such as rocks, driftwood, or substrate. Unlike many other aquatic plants, Java Fern doesn\'t require planting in the substrate; instead, it should be tied or attached to these surfaces. The rhizome, from which the leaves and roots grow, should be left exposed.\r\n\r\nJava Fern is known for its easy care requirements, making it suitable for both beginners and experienced aquarists. It is considered a low to moderate light plant, making it well-suited for aquariums with standard lighting setups. In terms of water conditions, it can adapt to a wide range of parameters, including a temperature range of 22-28°C, a pH of 6.0-7.5, and soft to moderately hard water.\r\n', '6.0-7.5', '22-28', 'Amazon Sword ');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to Moderate', 'Aquarium Plants', 'Araceae', 'Cryptocoryne', 'Yes', 'Southeast Asia', 'Mid-Ground', 'Rosette', , 'Cryptocoryne wendtii is a popular and attractive aquarium plant that hails from Southeast Asia, primarily found in countries like Sri Lanka, India, and Thailand. It belongs to the Araceae family and the Cryptocoryne genus.\r\n\r\nThis plant is known for its distinctive rosette growth pattern, featuring lance-shaped leaves that range in color from green to reddish-brown, depending on the specific variety. It\'s a relatively slow-growing plant, making it suitable for aquarists seeking a low-maintenance addition to their tanks.\r\n\r\nCryptocoryne wendtii is considered an easy-to-care-for plant, making it suitable for both novice and experienced aquarists. It thrives in low to moderate lighting conditions and doesn\'t require intense illumination. This plant is adaptable to a wide range of water conditions, with an ideal temperature range of 22-28°C, a pH of 6.0-7.5, and soft to moderately hard water.\r\n', '6.0-7.5', '22-28', 'Cryptocoryne wendtii');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to Moderate', 'Aquarium Plants', 'Hypnaceae', 'Taxiphyllum', 'Yes', 'Southeast Asia', 'Foreground ', 'Moss', , 'Java Moss (Taxiphyllum barbieri) is a widely recognized and versatile aquatic plant native to Southeast Asia, particularly countries like Indonesia, Malaysia, and the Philippines. It belongs to the Hypnaceae family and the Taxiphyllum genus.\r\n\r\nThis plant is known for its distinctive mossy appearance, featuring dense, branching structures composed of tiny, feathery leaves. Java Moss is incredibly adaptable and can be attached to various surfaces in the aquarium, such as rocks, driftwood, or substrate. It can create a lush and natural carpeting effect when allowed to grow freely.\r\n\r\nJava Moss is celebrated for its ease of care, making it an excellent choice for aquarists of all levels of experience. It thrives in low to moderate lighting conditions and doesn\'t require high-intensity illumination. In terms of water conditions, it can tolerate a wide range, including a temperature range of 22-28°C, a pH of 6.0-7.5, and water hardness ranging from soft to moderately hard.\r\n\r\nDue to its hardy nature and ability to adapt to varying water parameters, Java Moss is often used in aquariums to provide hiding places for small fish and fry. It also serves as a natural water purifier by absorbing excess nutrients and helping to reduce algae growth.\r\n\r\nOne of the advantages of Java Moss is its ability to be grown both submerged and emersed. This versatility allows it to be used in various aquascaping designs, from creating lush underwater landscapes to enhancing the appearance of terrariums and paludariums.\r\n\r\nJava Moss is a beloved choice among aquarists for its aesthetic appeal, low maintenance requirements, and numerous practical uses within the aquarium hobby.\r\n\r\n', '6.0-7.5', '22-28', 'Java Moss'),
('Easy', 'Low to High', 'Aquarium Plants', 'Ceratophyllaceae', 'Ceratophyllum', 'Yes', 'Native to North America, but widespread distribution', 'Floating', 'Stem', , 'Hornwort (Ceratophyllum demersum) is a popular and versatile aquatic plant that\'s known for its unique appearance and adaptability. It is native to North America but has become widely distributed around the world. Hornwort belongs to the Ceratophyllaceae family and the Ceratophyllum genus.\r\n\r\nThis plant has a distinctive appearance, with long, slender stems covered in fine, feathery leaves that resemble the antlers of a deer, hence its name. Hornwort can be used in various ways in an aquarium; it can be floated on the surface or anchored to the substrate or hardscape. Its rapid growth and ability to absorb excess nutrients make it a popular choice for both novice and experienced aquarists.\r\n\r\nHornwort\'s hardiness and adaptability are some of its most appealing qualities. It can thrive in a wide range of lighting conditions, from low to high, making it suitable for various aquarium setups. It can tolerate a broad temperature range, typically between 5-28°C, and a pH range of 6.0-7.5. Hornwort can also adapt to different water hardness levels, from soft to moderately hard water.\r\n\r\n', '6.0-7.5', '05-28', 'Hornwort ');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to Moderate', 'Aquarium Plants', ' Pteridaceae', 'Ceratopteris', 'Yes', 'Native to tropical regions worldwide', 'Mid-Ground', 'Fern', , 'Water Sprite (Ceratopteris thalictroides), also known as Indian Fern or Water Fern, is a popular and attractive aquatic plant native to tropical regions worldwide. It belongs to the Pteridaceae family and the Ceratopteris genus.\r\n\r\nThis plant is characterized by its delicate, finely dissected, bright green leaves that create a feathery appearance. Water Sprite can be placed in the mid-ground or background of the aquarium, and it can grow both submerged and emersed. Its versatility in aquascaping makes it a favored choice among hobbyists.\r\n\r\nWater Sprite is considered an easy-to-care-for plant, making it suitable for beginners and experienced aquarists alike. It thrives in low to moderate lighting conditions and doesn\'t require high-intensity illumination. In terms of water conditions, it can adapt to a wide range, with an ideal temperature range of 20-28°C, a pH of 6.0-7.5, and soft to moderately hard water.\r\n\r\n', '6.0-7.5', '22-28', 'Water Sprite'),
('Easy to Moderate', 'Low to High', 'Aquarium Plants', 'Hydrocharitaceae', 'Vallisneria', 'No', 'Vallisneria, commonly known as eelgrass or tape grass, can be found in regions worldwide, including North America, Europe, Asia, Australia, and Africa, where they grow in various freshwater and brackish water environments.', 'Background', 'Rosette', , 'Vallisneria, commonly known as Vallisneria or Eelgrass, is a popular genus of aquatic plants found in freshwater habitats around the world. It belongs to the Hydrocharitaceae family and encompasses several species, with Vallisneria spiralis and Vallisneria americana being among the most well-known in the aquarium trade.\r\n\r\nVallisneria is characterized by its long, ribbon-like leaves that can grow quite tall, making it an ideal choice for the background of aquariums. The appearance and growth pattern can vary slightly between different species and varieties, but they generally feature long, slender, and green or reddish-brown leaves.\r\n\r\nThis plant is considered easy to moderate in terms of care. Vallisneria is versatile and can adapt to a wide range of lighting conditions, from low to high. However, different species may have varying lighting preferences, so it\'s essential to consider the specific Vallisneria species you have.\r\n\r\nIn terms of water conditions, Vallisneria can tolerate temperatures between 20-28°C and a pH range of 6.5-8.0. It can also adapt to varying water hardness levels, from soft to moderately hard water.\r\n', '6.5-8.0', '20-28', 'Vallisneria');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to Moderate', 'Aquarium Plants', 'Plantaginaceae', 'Bacopa', 'Yes', 'Moneywort (Lysimachia nummularia), also known as Creeping Jenny, is native to Europe and western Asia, where it is commonly found.', 'Background', 'Stem', , 'Moneywort (Bacopa monnieri), also known as Water Hyssop, is a popular and versatile aquatic plant known for its ease of care and attractive appearance. It belongs to the Plantaginaceae family and the Bacopa genus.\r\n\r\nThis plant is characterized by its delicate, trailing stems and small, bright green leaves that grow in pairs along the stem. Moneywort is adaptable and can be used in various ways in the aquarium, either as a background plant, mid-ground accent, or even a foreground carpet in smaller tanks.\r\n\r\nMoneywort is considered an easy-to-care-for plant, making it suitable for both beginners and experienced aquarists. It thrives in low to moderate lighting conditions and doesn\'t require high-intensity illumination. In terms of water conditions, it can adapt to a wide range, with an ideal temperature range of 18-28°C, a pH of 6.0-7.5, and water hardness ranging from soft to moderately hard.\r\n', '6.0-7.5', '18-28', 'Moneywort ');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to High', 'Aquarium Plants', 'Acanthaceae', 'Hygrophila', 'Yes', 'Water Wisteria (Hygrophila difformis), a popular aquatic plant in the aquarium hobby, is native to the Indian subcontinent, specifically found in countries such as India, Bangladesh, and Nepal.\r\n\r\n\r\n\r\n\r\n', 'Background', 'Stem', , 'Water Wisteria (Hygrophila difformis) is a popular and visually appealing aquarium plant native to Southeast Asia. It belongs to the Acanthaceae family and the Hygrophila genus.\r\n\r\nThis plant is known for its finely pinnate leaves, which are green and feather-like in appearance. Water Wisteria is versatile and can be used in the background or mid-ground of aquariums to create a lush and natural look. It is a relatively easy-to-care-for plant suitable for beginners and experienced aquarists alike.\r\n\r\nWater Wisteria can thrive in a wide range of lighting conditions, from low to high. However, under high lighting, it tends to grow more compact and bushy, while under lower lighting, it may exhibit a more open and elongated growth pattern. It adapts to various water conditions, with an ideal temperature range of 20-28°C, a pH of 6.0-7.5, and water hardness ranging from soft to moderately hard.\r\n\r\nThis plant is a fast grower, so regular pruning may be necessary to maintain its shape and prevent it from overshadowing other aquarium plants. It is known for its ability to absorb excess nutrients from the water, which can help reduce algae growth.\r\n', '6.0-7.5', '20-28', 'Water Wisteria');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Moderate', 'Moderate to High', 'Aquarium Plants', 'Lythraceae', 'Rotala', 'Yes', 'Rotala rotundifolia, commonly known as \"Roundleaf Toothcup,\" is native to the Indian subcontinent, with its natural habitat spanning countries including India, Sri Lanka, and Thailand. This aquatic plant is well-regarded in the aquarium hobby for its ornamental qualities and adaptability.', 'Mid-Ground', 'Stem', , 'Rotala rotundifolia is a popular and visually striking aquarium plant native to Southeast Asia. It belongs to the Lythraceae family and the Rotala genus.\r\n\r\nThis plant is recognized for its slender stems and vibrant green to reddish-pink leaves, which can exhibit a round shape under certain conditions. Rotala rotundifolia is often used to add color and texture to the mid-ground or background of aquariums, contributing to a lush and natural aquatic landscape.\r\n\r\nThis plant requires moderate to high lighting to thrive and display its vibrant colors. In terms of water conditions, it prefers a temperature range of 22-28°C, a pH of 6.0-7.0, and soft to moderately hard water.\r\n\r\nRotala rotundifolia is considered a moderate-level plant, suitable for aquarists with some experience. It requires regular pruning and maintenance to encourage branching and maintain its desired shape. Like many other aquatic plants, it helps absorb excess nutrients from the water, which can aid in preventing algae growth.\r\n\r\n', '6.0-7.0', '22-28', 'Rotala rotundifolia');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Moderate', 'Moderate to High', 'Aquarium Plants', 'Onagraceae', 'Ludwigia', 'Yes', 'Native to North and Central America, it is often found in aquatic habitats throughout these regions.', 'Background', 'Stem', , 'Red Ludwigia (Ludwigia repens) is a striking and vibrant aquarium plant native to North and Central America. It belongs to the Onagraceae family and the Ludwigia genus.\r\n\r\nThis plant is renowned for its eye-catching red or reddish-brown leaves, which can vary in intensity depending on lighting and nutrient levels. It\'s commonly used to add a splash of color to the background or mid-ground of aquariums, creating a visually appealing contrast with green plants.\r\nRed Ludwigia requires moderate to high lighting to bring out its vivid colors and thrive. In terms of water conditions, it prefers a temperature range of 20-28°C, a pH of 6.0-7.5, and water hardness ranging from soft to moderately hard.\r\n\r\nMaintaining the vibrant red coloration of Red Ludwigia may require providing sufficient nutrients, particularly iron. Regular pruning is necessary to encourage bushy growth and maintain the desired shape. This plant is known for its ability to absorb excess nutrients, which can help prevent algae issues in the aquarium.\r\n', '6.0-7.5', '20-28', 'Red Ludwigia ');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to Moderate', 'Aquarium Plants', 'Hydrocharitaceae', 'Vallisneria', 'No', 'Indigenous to North America, it thrives in freshwater habitats such as lakes and slow-moving rivers.', 'Background', 'Rosette', , 'Corkscrew Vallisneria (Vallisneria americana var. contortionist) is a unique and visually appealing aquarium plant native to North America. It belongs to the Hydrocharitaceae family and the Vallisneria genus.\r\n\r\nThis plant is known for its distinctive corkscrew-like leaves, which spiral along the length of the stems. The corkscrew pattern adds an interesting and dynamic element to the background of aquariums, creating a captivating visual effect.\r\n\r\nCorkscrew Vallisneria is considered an easy-to-care-for plant, making it suitable for both beginners and experienced aquarists. It thrives in low to moderate lighting conditions and doesn\'t require high-intensity illumination. In terms of water conditions, it can adapt to a wide range, with an ideal temperature range of 20-28°C, a pH of 6.5-8.0, and water hardness ranging from soft to moderately hard.\r\n\r\nThis plant is a hardy and resilient choice that can help oxygenate the water and provide shelter for fish. Its relatively undemanding care requirements and unique appearance make it a favored addition to freshwater aquariums.\r\n\r\n', '6.5-8.0', '20-28', 'Corkscrew Vallisneria ');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to Moderate', 'Aquarium Plants', 'Alismataceae', 'Sagittaria', 'Yes', 'Native to North and Central America, it can be found in various freshwater environments, including ponds and streams.', 'Foreground ', 'Rosette', , 'Dwarf Sagittaria (Sagittaria subulata) is a popular and versatile aquarium plant native to North and Central America. It belongs to the Alismataceae family and the Sagittaria genus.\r\n\r\nThis plant is characterized by its grass-like appearance, featuring slender, green leaves that grow in a rosette pattern. Dwarf Sagittaria is commonly used in the foreground of aquariums to create a carpeting effect and add a natural look to the underwater landscape.\r\n\r\nDwarf Sagittaria is considered an easy-to-care-for plant, making it suitable for beginners and experienced aquarists. It thrives in low to moderate lighting conditions and doesn\'t require high-intensity illumination. In terms of water conditions, it can adapt to a wide range, with an ideal temperature range of 20-28°C, a pH of 6.5-7.5, and water hardness ranging from soft to moderately hard.\r\n\r\nThis plant is a relatively slow grower, and it spreads by sending out runners, which can eventually create a dense carpet of green in the foreground of the aquarium. Regular trimming may be necessary to maintain the desired height and shape.\r\n', '6.5-7.5', '20-28', 'Dwarf Sagittaria');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to High', 'Aquarium Plants', 'Araliaceae', 'Hydrocotyle', 'Yes', 'Indigenous to Central and South America, it\'s commonly seen in tropical and subtropical regions.', 'Background', 'Stem', , 'Brazilian Pennywort (Hydrocotyle leucocephala) is a versatile and fast-growing aquatic plant native to tropical regions worldwide. It belongs to the Araliaceae family and the Hydrocotyle genus.\r\n\r\nThis plant is known for its round, penny-sized leaves that grow along trailing stems. It can be used in various ways in the aquarium, either as a background plant when allowed to grow vertically or as a floating plant when allowed to drift on the water\'s surface.\r\n\r\nBrazilian Pennywort is considered an easy-to-care-for plant, making it suitable for both beginners and experienced aquarists. It can adapt to a wide range of lighting conditions, from low to high, although it may grow more compact and bushy under high lighting. In terms of water conditions, it prefers a temperature range of 20-28°C, a pH of 6.0-7.5, and water hardness ranging from soft to moderately hard.\r\n', '6.0-7.5', '20-28', 'Brazilian Pennywort '),
('Easy', 'Low to Moderate', 'Aquarium Plants', 'Polypodiaceae', 'Microsorum', 'No', 'Native to Southeast Asia, it grows in regions with high humidity and is often found in or near water bodies.', 'Mid-Ground', 'Fern', , 'Java Lace Fern (Microsorum pteropus \'Windelov\') is a popular and elegant aquarium plant native to Southeast Asia. It\'s a unique variant of the regular Java Fern, known for its finely dissected, lace-like leaves. This fern belongs to the Polypodiaceae family and the Microsorum genus.\r\n\r\nJava Lace Fern is considered an easy-to-care-for plant, making it suitable for both beginners and experienced aquarists. It thrives in low to moderate lighting conditions and doesn\'t require high-intensity illumination. In terms of water conditions, it can adapt to a wide range, with an ideal temperature range of 22-28°C, a pH of 6.0-7.5, and water hardness ranging from soft to moderately hard.\r\n', '6.0-7.5', '22-28', 'Java Lace Fern');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Moderate to High', 'Aquarium Plants', 'Alismataceae', 'Echinodorus', 'Yes', 'Native to North and Central America, it prefers the substrate of slow-moving rivers and ponds.', 'Foreground ', 'Rosette', , 'Pygmy Chain Sword (Echinodorus tenellus) is a popular and compact aquarium plant native to North and Central America. It belongs to the Alismataceae family and the Echinodorus genus.\r\n\r\nThis plant is characterized by its short and narrow leaves, which form dense, grass-like clusters in the foreground of the aquarium. Pygmy Chain Sword is considered an easy-to-care-for plant and is an excellent choice for aquarists looking to create a lush carpeting effect.\r\n\r\nPygmy Chain Sword prefers moderate to high lighting conditions to thrive and showcase its vibrant green coloration. In terms of water conditions, it prefers a temperature range of 20-28°C, a pH of 6.5-7.5, and water hardness ranging from soft to moderately hard.\r\n\r\nThis plant can spread by sending out runners, which allows it to create a dense carpet over time. Regular trimming and maintenance may be necessary to encourage horizontal growth and maintain the desired appearance.\r\n\r\n', '6.5-7.5', '20-28', 'Pygmy Chain Sword ');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Moderate to High', 'Aquarium Plants', 'Alismataceae', 'Echinodorus', 'Yes', ' Native to North America, it thrives in freshwater habitats with ample sunlight.', 'Foreground ', 'Rosette', , 'Narrow Leaf Chain Sword (Echinodorus tenellus \'Narrow Leaf\') is a variant of the Pygmy Chain Sword, known for its slender and narrow leaves. It\'s native to North and Central America and belongs to the Alismataceae family and the Echinodorus genus.\r\n\r\nThis plant is similar in care requirements to the Pygmy Chain Sword and is also considered easy to care for. It forms dense clusters of narrow, grass-like leaves in the foreground of the aquarium, creating a carpeting effect. It prefers moderate to high lighting conditions to thrive.\r\n\r\nIn terms of water conditions, Narrow Leaf Chain Sword does well in a temperature range of 20-28°C, a pH of 6.5-7.5, and soft to moderately hard water. Like the Pygmy Chain Sword, it can spread via runners and may require occasional pruning to maintain its desired appearance and encourage horizontal growth.\r\n\r\nWhen planting Narrow Leaf Chain Sword, ensure that the roots are buried in the substrate, and provide adequate spacing between individual plants for healthy development.\r\n', '6.5-7.5', '20-28', 'Narrow Leaf Chain Sword ');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to High', 'Floating Aquarium Plant', 'Araceae', 'Pistia', 'No', 'Indigenous to Southeast Asia, it\'s commonly found in marshy areas and slow-flowing rivers.', 'Floating', 'Floating', , 'Water Lettuce (Pistia stratiotes) is a unique and floating aquarium plant native to tropical and subtropical regions worldwide. It belongs to the Araceae family and the Pistia genus.\r\n\r\nThis plant is recognized for its rosette of light green leaves with a distinctive ribbed texture. Water Lettuce is a floating plant that drifts on the water\'s surface, providing shade and shelter for aquatic life below. It\'s known for its ease of care and adaptability.\r\n\r\nWater Lettuce can thrive in a wide range of lighting conditions, from low to high, although it may grow more compact in brighter light. In terms of water conditions, it prefers a temperature range of 20-28°C, a pH of 6.0-7.5, and water hardness ranging from soft to moderately hard.\r\n\r\n', '6.0-7.5', '20-28', 'Water Lettuce');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Moderate to High', 'Aquarium Plants', 'Acanthaceae', 'Hygrophila', 'Yes', 'Indigenous to Southeast Asia, it\'s commonly found in marshy areas and slow-flowing rivers.', 'Background', 'Stem', , 'Giant Hygro (Hygrophila corymbosa) is a popular and visually striking aquarium plant native to Southeast Asia. It belongs to the Acanthaceae family and the Hygrophila genus.\r\n\r\nThis plant is characterized by its tall, slender stems and broad, lance-shaped leaves. It\'s often used in the background of aquariums to create a lush and natural look. Giant Hygro is considered an easy-to-care-for plant, making it suitable for both beginners and experienced aquarists.\r\n\r\nTo thrive and maintain its vibrant green coloration, Giant Hygro prefers moderate to high lighting conditions. In terms of water conditions, it does well in a temperature range of 22-28°C, a pH of 6.0-7.5, and water hardness ranging from soft to moderately hard.\r\n\r\nRegular pruning and maintenance may be necessary to prevent overgrowth and maintain the desired shape. This plant is known for its ability to absorb excess nutrients from the water, which can help reduce algae growth.\r\n\r\n', '6.0-7.5', '22-28', 'Giant Hygro '),
('Easy to Moderate', 'Low to Moderate', 'Aquarium Plants', 'Menyanthaceae', 'Nymphoides', 'Yes', ' Native to North America, it grows in slow-moving or stagnant waters, often in shaded areas.', 'Mid-Ground', 'Rhizome', , 'The Banana Plant (Nymphoides aquatica) is an interesting and unique aquarium plant native to North America. It belongs to the Menyanthaceae family and the Nymphoides genus.\r\n\r\nThis plant is known for its round, floating leaves that resemble lily pads, giving it a distinctive and charming appearance. It can be used in the mid-ground of the aquarium, planted in the substrate, or allowed to float on the water\'s surface.\r\n\r\nThe Banana Plant is considered moderately easy to care for and is adaptable to a range of lighting conditions, from low to moderate. In terms of water conditions, it thrives at a temperature range of 20-28°C, a pH of 6.0-7.5, and soft to moderately hard water.\r\n\r\nOne of the intriguing aspects of the Banana Plant is its ability to change the shape of its leaves based on lighting conditions. In higher light, it can produce more elongated, arrow-shaped leaves, while in lower light, it may develop rounder, floating leaves.\r\n\r\n', '6.0-7.5', '20-28', 'Banana Plant ');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy to Moderate', 'Moderate to High', 'Aquarium Plants', 'Nymphaeaceae', 'Nymphaea', 'Yes', 'Native to Asia, it can be found in calm, shallow waters of ponds and lakes.', 'Mid-Ground', 'Rhizome', , 'Dwarf Water Lily (Nymphaea stellata) is a charming and compact aquatic plant native to Asia. It belongs to the Nymphaeaceae family and the Nymphaea genus.\r\n\r\nThis plant is characterized by its petite size and attractive lily pad leaves. It\'s often used in the mid-ground or background of aquariums to create a visually appealing aquatic display. Dwarf Water Lily is considered moderately easy to care for and is favored by aquarists for its graceful appearance.\r\n\r\nTo thrive and produce its signature lily pad leaves, Dwarf Water Lily prefers moderate to high lighting conditions. In terms of water conditions, it does well at a temperature range of 20-28°C, a pH of 6.0-7.5, and soft to moderately hard water.\r\n\r\nDwarf Water Lily should be planted with the rhizome partially buried in the substrate and the leaves reaching towards the water\'s surface. It\'s known for its ability to create a tranquil and natural atmosphere in the aquarium, providing shade and shelter for aquatic life below.\r\n', '6.0-7.5', '20-28', 'Dwarf Water Lily');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy to Moderate', 'Moderate to High', 'Aquarium Plants', 'Nymphaeaceae', 'Nymphaea', 'Yes', ' Indigenous to Africa, it grows in various aquatic environments, including lakes and slow streams.', 'Background', 'Rhizome', , 'Red Tiger Lotus (Nymphaea zenkeri) is a captivating and visually striking aquarium plant native to Africa. It belongs to the Nymphaeaceae family and the Nymphaea genus.\r\n\r\nThis plant is recognized for its vibrant and intricately patterned leaves, which can range in color from green to red. It\'s often used in the background or mid-ground of aquariums to create a bold and colorful focal point. Red Tiger Lotus is considered moderately easy to care for and is a favored choice for aquarists looking to add a touch of drama to their aquascapes.\r\n\r\nTo showcase its intense colors and patterns, Red Tiger Lotus prefers moderate to high lighting conditions. In terms of water conditions, it thrives at a temperature range of 22-28°C, a pH of 6.0-7.5, and soft to moderately hard water.\r\n\r\n', '6.0-7.5', '22-28', 'Red Tiger Lotus');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Easy', 'Low to Moderate', 'Floating Aquarium Plant', 'Phyllanthaceae', 'Phyllanthus', 'No', 'Native to South America, it floats on the surface of still or slow-flowing waters.', 'Floating', 'Floating', , 'Red Root Floater (Phyllanthus fluitans) is a captivating and floating aquarium plant native to South America. It belongs to the Phyllanthaceae family and the Phyllanthus genus.\r\n\r\nThis plant is known for its small, round leaves with striking red undersides, which create a beautiful contrast with the green upper surfaces. Red Root Floater is an easy-to-care-for floating plant, making it suitable for beginners and experienced aquarists alike.\r\n\r\nRed Root Floater does well in low to moderate lighting conditions and can thrive in a wide range of water conditions. It prefers a temperature range of 20-28°C, a pH of 6.0-7.5, and soft to moderately hard water.\r\n\r\nThis floating plant should simply be allowed to drift on the water\'s surface, creating a stunning and natural display in the aquarium. It\'s known for its ability to provide shade and shelter for aquatic life below while adding a pop of color to the aquatic environment.\r\n', '6.0-7.5', '20-28', 'Red Root Floater ');
INSERT INTO `plants` (`Hardiness`, `Lighting_Requirement`, `Category`, `Family`, `Genus`, `Grown_Emersed`, `Region`, `Aquascape_Placement`, `Plant_Type`, `Image`, `Description`, `pH_Level`, `Temperature`, `Plant_Name`) VALUES
('Moderate to Difficult', 'Low to Moderate', 'Aquarium Plants', 'Araceae', 'Cryptocoryne', 'Yes', 'Native to Southeast Asia, it prefers the substrate of slow-moving rivers and ponds.', 'Mid-Ground', 'Rhizome', , 'Cryptocoryne crispatula is a beautiful and diverse group of aquarium plants native to Southeast Asia. These plants belong to the Araceae family and the Cryptocoryne genus.\r\n\r\nCryptocoryne crispatula includes several variants, each with its unique leaf shapes and colors. They are commonly used in the mid-ground or background of aquariums to add texture and visual interest. However, they are considered moderately difficult to care for, making them more suitable for experienced aquarists.\r\n\r\nTo thrive, Cryptocoryne crispatula prefers low to moderate lighting conditions and a temperature range of 24-28°C. Water parameters should include a pH of 6.0-7.5 and soft to moderately hard water.\r\n\r\nThese plants should be planted with their rhizomes partially buried in the substrate and their leaves reaching toward the water\'s surface. It\'s important to note that different variants of Cryptocoryne crispatula may have varying care requirements, so specific care guidelines may apply to each variant.\r\n', '6.0-7.5', '24-28', 'Cryptocoryne crispatula');
